public void buryItem(int item, int slot) {
		if (duelRule[7] && inDuel && duelFight) {
			sendMessage("Food has been disabled for this duel");
			return;
		}
		boolean used = true;
		if (playerHasItem(item)) {
			switch (item) {
			case 526:
				prayerMessage(70);
				break;
			case 532:
				prayerMessage(115);
				break;
			case 3125:
				prayerMessage(300);
				break;
			case 536:
				prayerMessage(450);
				break;
			case 315:
				setAnimation(0x33D);
				animationReset = System.currentTimeMillis() + 750;
				currentHealth += 5;
				if (currentHealth > playerLevel[playerHitpoints])
					currentHealth = playerLevel[playerHitpoints];
				sendMessage("You eat the shrimps");
				break;
			case 379:
				setAnimation(0x33D);
				animationReset = System.currentTimeMillis() + 750;
				currentHealth += 12;
				if (currentHealth > playerLevel[playerHitpoints])
					currentHealth = playerLevel[playerHitpoints];
				sendMessage("You eat the lobster");
				break;
			case 385:
				setAnimation(0x33D);
				animationReset = System.currentTimeMillis() + 750;
				currentHealth += 75;
				if (currentHealth > playerLevel[playerHitpoints])
					currentHealth = playerLevel[playerHitpoints];
				sendMessage("You eat the Shark!");
				break;
			case 391:
				setAnimation(0x33D);
				animationReset = System.currentTimeMillis() + 750;
				currentHealth += 100;
				if (currentHealth > playerLevel[playerHitpoints])
					currentHealth = playerLevel[playerHitpoints];
				sendMessage("You eat the Manta Ray!");
				break;
			default:
				used = false;
				break;
			}
		}
		if (used)
			deleteItem(item, slot, 1);
	}[/code]
